    lines = content.split('\n')
    valid_positions = []
    block_stack = []
    
    for i, line in enumerate(lines):
        if i == 0:
            continue
            
        stripped_line = line.strip()
        if not stripped_line or stripped_line.startswith(('import ', 'from ', '#')):
            continue
            
        indent = len(line) - len(stripped_line)
        
        while block_stack and indent <= block_stack[-1][1]:
            block_stack.pop()
            
        if stripped_line.endswith(':'):
            block_stack.append((i, indent))
            continue
            
        current_block_indent = block_stack[-1][1] if block_stack else 0
        if indent >= current_block_indent:
            if any(stripped_line.startswith(keyword) for keyword in ['def ', 'class ']):
                valid_positions.append((i, indent))
            elif stripped_line.startswith('return '):
                valid_positions.append((i, indent))
            elif ('=' in stripped_line and 
                  not any(keyword in stripped_line for keyword in ['if', 'while', 'for']) and
                  not stripped_line.endswith(':')):
                valid_positions.append((i, indent))
            elif 'print(' in stripped_line or 'input(' in stripped_line:
                valid_positions.append((i, indent))
    
    if valid_positions:
        code_size = len(lines)
        base_checks = max(12, min(code_size // 10, 50))
        variation = base_checks // 4
        num_checks = random.randint(base_checks - variation, base_checks + variation)
        positions = random.sample(valid_positions, min(num_checks, len(valid_positions)))
        positions.sort(reverse=True)
        
        for pos, indent in positions:
            check = generate_random_check()
            lines.insert(pos + 1, ' ' * indent + check)
    
    return header + '\n'.join(lines) 